// src/pages/Home.js

import React from 'react';
import { Button, Row, Col } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import '../styles/Home.css';
import HomeVideo from '../assets/video/HomeVideo.mp4';

function Home() {
  const navigate = useNavigate();

  const handleNavigation = (path) => {
    navigate(path);
  };

  return (
    <div className="video-background">
      <video autoPlay loop muted className="video">
        <source src={HomeVideo} type="video/mp4" />
        Seu navegador não suporta o vídeo.
      </video>
      <div className="content d-flex flex-column align-items-center justify-content-center text-center vh-100">
        <h1 className="display-1 title">HEALTH HORIZON</h1>
        <h3 className="subtitle mt-3">SELECIONE SEU PERFIL</h3>
        <Row className="button-row mt-4">
          <Col>
            <Button variant="primary" className="profile-button" onClick={() => handleNavigation('/paciente')}>
              PACIENTE
            </Button>
          </Col>
          <Col>
            <Button variant="secondary" className="profile-button" onClick={() => handleNavigation('/medico')}>
              MÉDICO
            </Button>
          </Col>
          <Col>
            <Button variant="success" className="profile-button" onClick={() => handleNavigation('/admin')}>
              ADMIN
            </Button>
          </Col>
        </Row>
      </div>
    </div>
  );
}

export default Home;
